import React from 'react';
import './Projects.css';

const Projects = props => {

    return (
        <div>
            <h1>Featured Projects</h1>
            <div className="header-underline" />
            <div className="project-container">
                <p>Project name</p>
            </div>
        </div>
    )
}

export default Projects;
